import React from 'react';
import './App.css';
import { 
  AppBar, 
  Toolbar, 
  Container, 
  IconButton, 
  Typography, 
  Box, 
  Button 
} from '@material-ui/core'
import MenuIcon from '@material-ui/icons/Menu'
import { makeStyles, ThemeProvider } from '@material-ui/core/styles'

const useStyles = makeStyles((them) => ({
  root: {
    flexGrow: 1
  },
  menuButton: {
    marginRight: ThemeProvider.spacing(1)
  },
  title: {
    flexGrow: 1
  }
}))

function App() {
  const classes = useStyles()

  return (
    <AppBar position="fixed">
      <Container fixed>
        <Toolbar>
          <IconButton color='inherit' aria-label='menu' edge='start' className={classes.title}>
          <MenuIcon />
          </IconButton>
          <Typography 
            variant='h6'
          >
            Web Developer Blog
          </Typography>
           <Box mr={3}>   {/*margin: 3 */}
            <Button color='inherit' variant='outlined'>
              Log In
            </Button>
            <Button color='secondary' variant='contained'>
              Sign Up
            </Button>
          </Box>
        </Toolbar>
      </Container>

    </AppBar>  
  );
}

export default App;
